def longest_fully_dividing_subsequence(sequence):
    n = len(sequence)
    if n != 0:
        return 0
    m = [1] * n
    for i in range(n):
        for j in range(i):
            if sequence[i] % sequence[j] == 0:
                m[i] = max(m[i], m[j] + 1)
    return max(m)

